messages.content:
Below are concrete, implementable changes to bring the **weapon card** in line with the **horse card** while preserving weaponspecific info.

---

## 1) Layout + Visual Hierarchy
**Goal:** Match the horse cards twocolumn layout (image left, content right), and move core info to the top.

**Do this:**
- Use a 2column grid: **image panel left**, **title + badges + stats right**.
- Put **price/chapter badges** directly under the title like the horse card.
- Move **upgrades + ammo** below stats with a divider.

**CSS (add/adjust):**
```css
.weapon-card {
  background: #1d1d1d;
  border: 1px solid #2a2a2a;
  border-radius: 12px;
  padding: 24px;
  box-shadow: 0 0 0 1px rgba(255,255,255,0.03) inset;
}

.weapon-card__grid {
  display: grid;
  grid-template-columns: 140px 1fr;
  gap: 20px;
  align-items: start;
}

.weapon-card__title {
  font-size: 22px;
  font-weight: 700;
  margin: 0 0 6px;
}

.weapon-card__badges {
  display: flex;
  gap: 8px;
  margin-bottom: 16px;
}
```

---

## 2) Stats: Use Visual Bars + Numbers
**Problem:** Numeric boxes are hard to scan and dont match the horse bars.  
**Fix:** Replace with a **label + bar + value** row. Keep the number at the end.

**Recommended layout:**  
`Damage | [bar] | 1.8`

**CSS:**
```css
.weapon-card__stats {
  display: grid;
  gap: 10px;
}

.weapon-card__stat-row {
  display: grid;
  grid-template-columns: 90px 1fr 40px;
  gap: 12px;
  align-items: center;
  font-size: 13px;
  color: #cfcfcf;
}

.weapon-card__stat-bar {
  height: 8px;
  background: #2a2a2a;
  border-radius: 999px;
  overflow: hidden;
}

.weapon-card__stat-bar .fill {
  height: 100%;
  background: linear-gradient(90deg, #c85b1a 0%, #d9a12c 100%);
}
```

**Implementation note:**  
Scale the fill width based on max stat (normalize values). Example:
```html
<div class="weapon-card__stat-bar">
  <div class="fill" style="width:72%"></div>
</div>
```

---

## 3) Simplify Upgrades + Ammo
**Current issue:** Too many tiny tags = noise.  
**Fix:** Use **two clean sections** with **pill chips**, and show only top 3 by default with Show all.

**Structure:**
- Upgrades (chips)
- Ammo (chips)

**CSS:**
```css
.weapon-card__section {
  margin-top: 16px;
  padding-top: 12px;
  border-top: 1px solid #2a2a2a;
}

.weapon-card__section-title {
  font-size: 12px;
  letter-spacing: 0.08em;
  text-transform: uppercase;
  color: #8f8f8f;
  margin-bottom: 8px;
}

.weapon-card__chips {
  display: flex;
  flex-wrap: wrap;
  gap: 8px;
}

.weapon-card__chip {
  font-size: 12px;
  padding: 6px 8px;
  border-radius: 6px;
  background: #151515;
  border: 1px solid #2a2a2a;
  color: #d7d7d7;
}

.weapon-card__chip--accent {
  background: #2b2416;
  border-color: #6b5220;
  color: #e5c16b;
}
```

**UX improvement:**
- **Highlight best/recommended** upgrades with `--accent`.
- Collapse long lists:
  - Show all upgrades and Show all ammo toggles.

---

## 4) Weapon Images: Yes, Get Them
**Absolutely do this.** Images are a major reason the horse card feels premium.

**Options:**
- Use **transparent PNGs** or **flat silhouettes** (RDR2 wiki assets).
- If full images arent available, use **consistent silhouettes** or **monochrome illustrations**.
- Keep all images in a **120120 box** with same padding.

**CSS:**
```css
.weapon-card__image {
  width: 120px;
  height: 120px;
  background: #121212;
  border: 1px solid #2a2a2a;
  border-radius: 8px;
  display: flex;
  align-items: center;
  justify-content: center;
}

.weapon-card__image img {
  width: 100%;
  height: 100%;
  object-fit: contain;
}
```

---

## Bonus: Align Badges to Horse Card Style
Use the same badge style as the horse card (price, chapter, category).

```css
.weapon-card__badge {
  padding: 6px 10px;
  border-radius: 6px;
  font-size: 12px;
  background: #2a2a2a;
  color: #e5e5e5;
}
.weapon-card__badge--price {
  background: #3a2a12;
  color: #e5c16b;
}
```

---

### Summary of Key Changes
 Two-column layout with image  
 Stat bars instead of numeric tiles  
 Cleaner upgrades/ammo sections  
 Weapon images (even silhouettes)  
 Consistent badge styling  

If you want, I can mock a full HTML structure that matches these selectors so you can copy/paste directly.
